import React, { Component } from 'react'

export default class Table extends Component {

    state = {
        users: [
            {
                nomer: "N",
                name: "Name",
                age: "Age",
                year: "Year",
                isMarried: "Is Married",
                email: "@Email"
            },
            {
                nomer: 1,
                name: "Davlatshoh",
                age: "22",
                year: "1999",
                isMarried: "Single",
                email: "Davaltshoh99.@mail.ru"
            },
            {
                nomer: 2,
                name: "Dilshod",
                age: 21,
                year: 2000,
                isMarried: "Single",
                email: "Dilshod@mail.ru"
            }
        ]
    }




    render() {
        return (
            <div className='table'>
                <div>
                    <table>
                        <thead>
                            {
                                this.state.users.map((item, index) => {
                                    <tr></tr>
                                })
                            }


                        </thead>
                    </table>
                </div>

            </div>
        )
    }
}
